import { Link } from "react-router-dom";
import "../stylesheets/UX.scss";

const UX = () => {
  return (
    <div className="ux">
      <Link to="/" className="">
        <span className="">landing</span>
      </Link>
      <Link to="/Front/" className="">
        <span className="">front-end developer</span>
      </Link>
    </div>
  );
};

export default UX;
